import { useState } from 'react';
import { Bank } from '../types/types';
import Dashboard from '../components/Dashboard/Dashboard';

const payment = ()=> {
    const [banks, bankStatus] = useState([
        new Bank(1234, 'Sterling Bank', '2357810094', 'current', '256092341625', 'verified')
    ]);

    const addNewBank = () =>{
        banks.push(new Bank(1234, 'GT Bank', '2357810094', 'current', '256092341625', 'verified'));
        bankStatus(banks);  
    }

    return <Dashboard pageTitle="Payments - EazyRent" route="payment" banks={banks} addBank={addNewBank}/>;
};

export default payment;
